// api/productApi.js

import axiosClient from "api/axiosClient"
class JsonPlaceHolderApi {
    getAll = (params) => {
    const url = '/posts';
    return axiosClient.post(url, { params });
    };
    }
    const jsonPlaceHolderApi = new JsonPlaceHolderApi();
    export default jsonPlaceHolderApi;
